import React from "react";
import Header from "./pages/Header";
import "./landing.css";
import Main from "./pages/Main";
import Footer from "./pages/Footer";
import { Link } from "react-router-dom";
function Landing() {
  return (
    <>
      <Link to="/category/phones">asd</Link>
      <Header />
      <Main />
      <Footer />
    </>
  );
}

export default Landing;
